import './App.css';
import Person from './Person/Person'

class App extends Component {
  state = {
    persons: [
      {name: 'Max', age: 28},
      {name: 'Manu', age: 29},
      {name: 'Chicken', age:32}
    ]
  }
  render() {
    return(
      <div className="App">
        <h1>Hi, I'm a react app</h1>
        <p>Hi dog!</p>
        <button>Switch Name</button>
        <Person name="Max" age="28">My hobbies: racing</Person>
        <Person name="Bob" age="28">My hobbies: chicken</Person>
        <Person name="Chicken" age="28">My hobbies: dog</Person>
        <Person name="Dog" age="28">My hobbies: pig</Person>

      </div>
  );
